        "display": true,
        "restricted": false,
        "layerName": "plataforma:educ_mpeduc_status",
        "description": "O Ministério Público pela Educação (MPEduc) é um projeto desenvolvido para ser executado em parceria entre o Ministério Público Federal e o Ministério Público dos Estados. Como o nome descreve, seu principal objetivo é o de estabelecer o direito à educação básica de qualidade para os brasileiros.\r\nDo total de 92 Municípios do Estado do Rio de Janeiro o projeto MPEduc esta/esteve atuando em 20, dos quais apenas 3 finalizaram o projeto por completo (Belford Roxo, Seropédica e Vassouras). \r\nFonte: INEP; Ministérios Públicos Estaduais e Ministério Público Federal| - Período: 2013 - 2016",
