            "id": 0,
            "title": "Cinturão Epidemiológico 5 (20/MAR)",
            "name": "plataforma:saude_febreamarela_situacao_5",
            "description": "A Secretaria de Estado de Saúde ampliará a vacinação prioritária contra febre amarela para os municípios de Teresópolis, São José do Vale do Rio Preto, Guapimirim, Petrópolis, Magé, Areal, Paty do Alferes, Miguel Pereira e Engenheiro Paulo de Frontin. Paraíba do Sul e Três Rios, que já estavam na zona de bloqueio das divisas com MG e ES, terão reforço de doses e vacinação intensificada. A medida preventiva foi tomada após um macaco morto com suspeita de febre amarela ser encontrado na região de Juiz de Fora (MG), que faz divisa com a Região Serrana do Rio. Cinco municípios da Região dos Lagos foram incluídos na Sexta-feira (17/03) no cinturão de proteção de Casimiro de Abreu: Saquarema, São Pedro da Aldeia, Armação dos Búzios, Arraial do Cabo e Iguaba Grande, além de Carapebus, Quissamã e São João da Barra, no Norte Fluminense. Com a inclusão dessas cidades na antecipação do calendário de imunização, o Estado já está vacinando um total de 64 municípios estratégicos. A prioridade da campanha será imunizar a população residente ou que trabalha em áreas de mata e zonas rurais. Dando continuidade à estratégia de priorizar municípios mais vulneráveis para a vacinação contra febre amarela, a Secretaria de Estado de Saúde incluiu Maricá, na região metropolitana, na lista de cidades estratégicas para a imunização da população. Além do município, regiões específicas de Itaboraí, localizadas próximas à divisa com Maricá, também passam a fazer parte das áreas estratégicas para a vacinação. FONTE: ConexãoSaúdeRJ",
