        "description": "Índice de Criminalidade Geral - ICG desenvolvido pelo MPRJ em Mapas com base na análise de dados criminais divulgados pelo Instituto de Segurança Pública do Estado do Rio de Janeiro para 20 crimes no intervalo de 2012 a 2016 através de métodos de estatística multivariada.\r\n\r\nCrimes analisados:\r\n * homicídios: doloso / culposo / decorrente de intervenção policial\r\n * lesão corporal: dolosa / seguida de morte / culposa dolosa\r\n * latrocínio\r\n * tentativa de homicídio\r\n * estupro\r\n * roubos: de veículos / de carga / de celular / em coletivos / à transeuntes\r\n * furto de veículos, extorsão, estelionato, apreensões: de drogas / de armas\r\n * ameaça",
